import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import "./css/commun.css";
import Banner from "./modules/components.js";
import Fella from "./modules/extras";
import { Species, SpeciesList } from './modules/species.js';


function App() {

    return (
        <>
            <Banner />
            <Router>
                <Routes>
                    <Route exact path="/sharks/:id" element={<Species />} />
                    <Route exact path="/sharks" element={<SpeciesList />} />
                    <Route exact path="*" element={<p>Error: page not found</p>} />
                </Routes>
            </Router>
            <Fella />
        </>
    );
}

export default App;
